import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common";
import { AppMainComponentComponent } from "./components/app-main-component/app-main-component.component";
import { AppHeaderComponent } from "./components/app-header/app-header.component";
import { AppFooterComponent } from "./components/app-footer/app-footer.component";
import { RouterOutlet } from "@angular/router";
import { PageLayoutRoutingModule } from "./page-layout-routing.module";

@NgModule({
  declarations: [
    AppMainComponentComponent,
    AppHeaderComponent,
    AppFooterComponent,
  ],
  imports: [CommonModule, RouterOutlet, PageLayoutRoutingModule],
})
export class PageLayoutModule {}
